INSERT INTO `par_economic_situation` VALUES (1, 2, '国内经济增长持续趋缓，且近期弱势特征明显，预计通货膨胀率将由49%降至3.5%左右。', '在过去几个阶段，中央银行实行的高度紧缩的货币政策的影响现在开始显现。国内利率下降，货币市场利率反映更为强烈。收益曲线在两年中将首次出现平稳局面。\r\n预计储蓄率增长，贷款需求下降。\r\n债券利率的趋势也将和市场利率相同。股票市场将随着利率的变动而显著变动。', '全球经济趋势以极端的不确定性为特征，但最近阶段经济形势保持相对稳定。周边地区的经济发展可能对资本有旺盛的需求。\r\n国际利率小幅浮动，在高度的不确定情况下，股票市场的趋势为谨慎下浮。');
INSERT INTO `par_economic_situation` VALUES (2, 3, '前一阶段经济增长趋势明显，本阶段预计增长率3%- 3.5%。预计的通货膨胀率将维持在2%左右。', '中央银行推行适度扩张的货币政策以刺激经济。因此货币市场利率大幅下降。资本市场利率也有相同的下降趋势。利率政策的实施将有助于股票市场的上扬。', '国内经济对周边及世界经济的依存度增强。随着国际资本需求的增加，国际利率呈现上扬态势。这种趋势将持续相当长的-段时间。');
INSERT INTO `par_economic_situation` VALUES (3, 4, '国内经济已度过低迷时期，出口贸易的增长成为国内经济回升的主要推动力。\r\n预期通货膨胀水平将有轻微的上升。', '中央银行扩张性的货币政策已经引起了本阶段货币资本市场利率的些微升高，并造成股票市场的小幅震荡。', '全球经济再度受制于对资本的高度需求。因此，国际市场上利率进一步上扬，在工业国家尤其如此，通货膨胀竞相上涨成为普遍关注的问题，推行紧缩性货币政策成为这些国家和地区中央银行的主要手段。\r\n在高利率和不断上升的货币市场的共同作用下，股票市场价格持续受到压力，按权威人士称，这将使未来阶段过热的危险得到一定程度的转移。');
INSERT INTO `par_economic_situation` VALUES (4, 5, '在前一阶段，出口方面是增长的主要推动力。现在，国内需求快速增长。预计经济增长大约为5.5%。 因此，信贷需求上升，同时储蓄率下降。通货膨胀率预计将达到5%。', '中央银行适度从紧的货币政策仍将持续，这将推动利率的充分上扬。与此同时，预期通货膨胀水平的升高，进一步推动了投资和消费活动，导致利率的大幅变动，这也将使股票市场受到相当大的压力。', '近两年周边地区的经济增长缓慢，可以相信经济过热现象将不会出现。在此背景下，国际市场利率明显下调，股票成为特别吸引投资的工具。');
INSERT INTO `par_economic_situation` VALUES (5, 6, '国内经济继续保持高速增长，已经出现了局部过热的信号。过高的利率水平使银行按揭贷款业务的信用风险因此而加大。', '由于利率水平仍在向上攀升，中央银行还将维持紧缩性货币政策。前阶段利率的升高已经被股票市场所吸收。公众对经济前景的良好预期以及公司预期利好的驱动对股票市场产生了正面的作用。', '旺盛的资本需求正在推动长期利率的上升。通货膨胀水平持续升高，各国中央银行已清醒地认识到这一点并 果断采取行动，所采用的方法已被市场很好地接受，预计利率在未来的时期内将不再上涨。');
INSERT INTO `par_formula` VALUES (1, '短期贷款-抵押贷款', 2.00);
INSERT INTO `par_formula` VALUES (2, '短期贷款-质押贷款', 2.00);
INSERT INTO `par_formula` VALUES (3, '短期贷款-保证贷款', 2.00);
INSERT INTO `par_formula` VALUES (4, '短期贷款-信用贷款', 2.00);
INSERT INTO `par_formula` VALUES (5, '贴现', 2.00);
INSERT INTO `par_formula` VALUES (6, '长期贷款-抵押贷款', 2.00);
INSERT INTO `par_formula` VALUES (7, '长期贷款-质押贷款', 2.00);
INSERT INTO `par_formula` VALUES (8, '长期贷款-保证贷款', 2.00);
INSERT INTO `par_formula` VALUES (9, '长期贷款-信用贷款', 2.00);
INSERT INTO `par_formula` VALUES (10, '短期存款', 2.00);
INSERT INTO `par_formula` VALUES (11, '短期储蓄存款', 2.00);
INSERT INTO `par_formula` VALUES (12, '同业存放款项', 2.00);
INSERT INTO `par_formula` VALUES (13, '长期存款', 2.00);
INSERT INTO `par_formula` VALUES (14, '长期储蓄存款', 2.00);
INSERT INTO `par_formula` VALUES (15, '委托资产托管业务', 2.00);
INSERT INTO `par_formula` VALUES (16, '担保业务', 2.00);
INSERT INTO `par_formula_total` VALUES (1, '资产负债表', '现金', '1.当资产<负债时，现金=负债-资产。2.当资产>负债时，现金=本阶段流动性报表：现金流动性要求的金额');
INSERT INTO `par_formula_total` VALUES (2, '资产资债表', '存放中央银行款项', '为本期填入数。最低额≥上阶段各类存款余额之和＊法定存款准备金率＊1.20（0阶段为4.5%，以后各期在黄页中提示）， 系数1.2为包含了备付金（超额准备）');
INSERT INTO `par_formula_total` VALUES (3, '资产资债表', '存放同业款项', '为本期填入数。');
INSERT INTO `par_formula_total` VALUES (4, '资产资债表', '拆放同业', '为本期填入数，最高额≤（短期存款+短期储蓄存款+长期存款+长期储蓄存款+存入短期保证金+存入长期保证金）*8%');
INSERT INTO `par_formula_total` VALUES (5, '资产资债表', '短期贷款', '短期贷款市场总额*短期贷款市场份额');
INSERT INTO `par_formula_total` VALUES (6, '资产资债表', '应收利息', '利润表：利息收入×2.65％');
INSERT INTO `par_formula_total` VALUES (7, '资产资债表', '贴现', '贴现市场总额*贴现市场份额');
INSERT INTO `par_formula_total` VALUES (8, '资产资债表', '短期投资', '为学员本期填入的各类短期债券（投资业务营业数据表：短期债券投资的名义价值的总计）与短期股票投资（投资业务营业数据表：短期股票投资的股票价值的期末持有）之和');
INSERT INTO `par_formula_total` VALUES (9, '资产资债表', '流动资产合计', '现金+存放中央银行款项+存放同业款项+拆放同业+短期贷款+应收利息+贴现+短期投资');
INSERT INTO `par_formula_total` VALUES (10, '资产资债表', '中长期贷款', '中长期贷款市场总额*中长期市场份额');
INSERT INTO `par_formula_total` VALUES (11, '资产资债表', '减：贷款损失准备', '上阶段贷款损失准备＋（短期贷款+贴现+中长期贷款期末余额）×0.606%');
INSERT INTO `par_formula_total` VALUES (12, '资产资债表', '长期债权投资', '上阶段长期债权投资＋本期填入数');
INSERT INTO `par_formula_total` VALUES (13, '资产资债表', '长期股权投资', '上阶段长期股权投资＋本期填入数');
INSERT INTO `par_formula_total` VALUES (14, '资产资债表', '长期资产合计', '中长期贷款-贷款损失准备+长期债权投资+长期股权投资+固定资产');
INSERT INTO `par_formula_total` VALUES (15, '资产资债表', '固定资产', '每期数据＝上阶段固定资产×90％＋本期自动化投资数据(人事后勤表中的自动化投资，如果没开启此业务则为0)');
INSERT INTO `par_formula_total` VALUES (16, '资产资债表', '无形资产', '始终为0阶段数450');
INSERT INTO `par_formula_total` VALUES (17, '资产资债表', '其它资产', '始终为0阶段数450');
INSERT INTO `par_formula_total` VALUES (18, '资产资债表', '无形资产及其他资产合计', '无形资产+其他资产');
INSERT INTO `par_formula_total` VALUES (19, '资产资债表', '资产总计', '流动资产合计+长期资产合计+无形资产及其他资产合计');
INSERT INTO `par_formula_total` VALUES (20, '资产资债表', '向中央银行借款', '数据根据系统运算结果确定：当资产大于负债时，将生成搭桥贷款，即流动性报表中的“现金清偿力”＜0；搭桥贷款首先补足流动性（现金），其金额=现金流动性要求（Ⅰ）的绝对值；其次，用于平衡资产负债双方的差额。其利息支出记入利润表“金融机构往来利息支出”项目下。1.当资产<负债时，向中央银行借款=02.当资产>负债时，向中央银行借款=资产-负债-现金清偿力（流动性报表：现金流动性的现金清偿力）');
INSERT INTO `par_formula_total` VALUES (21, '资产资债表', '短期存款', '短期存款市场总额*短期存款市场份额');
INSERT INTO `par_formula_total` VALUES (22, '资产资债表', '短期储蓄存款', '短期储蓄存款市场总额*短期储蓄市场份额');
INSERT INTO `par_formula_total` VALUES (23, '资产资债表', '同业拆入', '为本期填入数，最高额≤（短期存款+短期储蓄存款+长期存款+长期储蓄存款+存入短期保证金+存入长期保证金）*8%');
INSERT INTO `par_formula_total` VALUES (24, '资产资债表', '存入短期保证金', '若不做中间业务，则，＝上阶段存入短期保证金×（1+增长率18.5％）；若做中间业务，则，＝担保业务营业额×80%的长短期占比×60%的保证金缴存比率×（1+增长率18.5％）');
INSERT INTO `par_formula_total` VALUES (25, '资产资债表', '应付利息', '（短期存款＋短期储蓄存款＋存入短期保证金＋长期存款＋长期储蓄存款＋存入长期保证金）×各类存款算术平均利率(1.2%)×65％');
INSERT INTO `par_formula_total` VALUES (26, '资产资债表', '长期存款', '长期存款市场总额*长期存款市场份额');
INSERT INTO `par_formula_total` VALUES (27, '资产资债表', '长期储蓄存款', '长期储蓄存款市场总额*长期储蓄存款市场份额');
INSERT INTO `par_formula_total` VALUES (28, '资产资债表', '存入长期保证金', '若不做中间业务，则＝上阶段存入长期保证金＊（1+增长率15％）。若做中间业务，则＝担保业务营业额×20%的长短期占比×60%的保证金缴存比率（1+增长率15％）');
INSERT INTO `par_formula_total` VALUES (29, '资产资债表', '应付长期债券', '根据学员填入数确定。余额=上阶段应付长期债券－50＋学员填入数。该余额与应付次级债券的余额总量之和≤股东权益＊40％。');
INSERT INTO `par_formula_total` VALUES (30, '资产资债表', '应付次级债券', '根据学员填入数确定。余额=上阶段应付次级债券＋学员填入数。该余额与长期债券的余额总量之和≤股东权益＊40％。');
INSERT INTO `par_formula_total` VALUES (31, '资产资债表', '股本', '若不进行增资扩股游戏，则该项目始终不变；若进行增资，则股本＝期初股本＋新增股本（学员决策）');
INSERT INTO `par_formula_total` VALUES (32, '资产资债表', '资本公积', '若不进行增资扩股游戏，则该项目始终不变；若进行增资，则资本公积＝期初资本公积＋新增资本公积＝期初资本公积＋新增股数＊（发行价－1）＝期初资本公积＋新增股数＊［（上期股价＊80％）－1］。其中：发行价＝上期股价*80％；新增股数＝新增股本／1元');
INSERT INTO `par_formula_total` VALUES (33, '资产资债表', '盈余公积', '当净利润＞0时，上期数＋本期净利润＊15％；当净利润＝0时，仍为上期数；当净利润＜0时，为补亏后的剩余数');
INSERT INTO `par_formula_total` VALUES (34, '资产资债表', '一般风险准备', '1.=“存放同业款项+同业拆入+短期贷款+贴现+短期投资+中长期贷款-贷款损失准备+长期债券投资+长期股权投资”*1.5%，从净利润中抵减。2.一般风险准备额达到这个比例后，不再计提');
INSERT INTO `par_formula_total` VALUES (35, '资产资债表', '未分配利润', '当本期净利润＞0时，=上期数-上期股利+本期净利润＊85％（做分红决策时进行，分配的是上期股利，若上期利润≤0，则不得分配股利，不做分红决策时股利为0）；当本期净利润≤0时，=上期数-上期股利+本期净利润。股利＝上期股本*分红比例(学员决策)≤上期净利润＊85％');
INSERT INTO `par_formula_total` VALUES (36, '利润表', '利息收入', '∑（短期抵押贷款×抵押贷款利率 + 短期质押贷款×质押贷款利率 + 短期保证贷款×保证贷款利率 + 短期信用贷款×信用贷款利率 +贴现×贴现利率 + 中长期抵押贷款×中长期抵押贷款利率 + 中长期质押贷款×中长期质押贷款利率 + 中长期保证贷款×中长期保证贷款利率 + 中长期信用贷款×中长期信用贷款利率）');
INSERT INTO `par_formula_total` VALUES (37, '利润表', '金融机构往来利息收入', '∑（存放中央银行款项×利率+存放同业款项*利率+同业拆入×利率）');
INSERT INTO `par_formula_total` VALUES (38, '利润表', '手续费收入', '若不做中间业务，则=资产托管业务0阶段营业额*1%+担保业务0阶段营业额*0.5%；若做中间业务，则=资产托管业务营业额×手续费率+担保业务营业额×手续费率');
INSERT INTO `par_formula_total` VALUES (39, '利润表', '营业收入合计', '利息收入+金融机构往来利息收入+手续费收入');
INSERT INTO `par_formula_total` VALUES (40, '利润表', '利息支出', '∑(各项存款余额×利率＋发行长期债券×利率+发行次级债券×利率)');
INSERT INTO `par_formula_total` VALUES (41, '利润表', '金融机构往来利息支出', '上阶段向中央银行借款×本阶段搭桥贷款利率+同业存放款项×利率+拆放同业×利率（注：此处向中央银行借款因与资产负债表数据形成死循环，雇佣上期数）');
INSERT INTO `par_formula_total` VALUES (42, '利润表', '手续费支出', '若不做投资业务，则该项目金额=上阶段数×（1+20%）；若做投资业务，则（短期债券＋短期股票＋长期债权投资＋长期股权投资）的本阶段买卖营业额＊2.5％×（1+20%）');
INSERT INTO `par_formula_total` VALUES (43, '利润表', '营业支出合计', '利息支出+金融机构往来利息支出+手续费支出');
INSERT INTO `par_formula_total` VALUES (44, '利润表', '人员开支', '∑（贷款业务期末员工数*贷款业务工资标准 + 存款业务期末员工数*存款业务工资标准 + 投资业务期末员工数*投资业务工资标准 + 中间业务期末员工数*中间业务工资标准 + 其他业务期末员工数*其他业务工资标准）');
INSERT INTO `par_formula_total` VALUES (45, '利润表', '附加人员开支', '人员开支×附加人员成本（不低于12%，由学员填写）');
INSERT INTO `par_formula_total` VALUES (46, '利润表', '其他人员开支', '加班费、临时用工费、培训费等；每小时雇佣临时工支出×雇佣总时数(结果不正确)');
INSERT INTO `par_formula_total` VALUES (47, '利润表', '固定资产折旧', '上期末固定资产净额×10%');
INSERT INTO `par_formula_total` VALUES (48, '利润表', '其它营业费用', '1、若不做广告，广告基本费用默认为200百万元，2、若作广告，按实际数（各阶段客户分类广告费＋各阶段业务分类广告费）＋｛固定成本（注：若不参与报价，该项为0；若参与债券发行报价并获得承销资格，则该项费用为1000万，若参与报价但未能获得承销资格，则为300万）+发行金额×1%｝＋资产托管业务营业额×0.1%＋担保业务营业额×0.05%）+购买市场竞争报告费200万元');
INSERT INTO `par_formula_total` VALUES (49, '利润表', '营业费用合计', '人员开支+附加人员开支+其他人员开支+固定资产折旧+其它营业费用');
INSERT INTO `par_formula_total` VALUES (50, '利润表', '投资收益', '投资业务营业数据表中 (短期股票投资：股息+账面损益) + (长期股票投资：股息+账面损益) + (短期债券投资：股息+账面损益) + (短期债券投资：股息+账面损益)');
INSERT INTO `par_formula_total` VALUES (51, '利润表', '营业利润', '营业收入合计－营业支出合计－营业费用合计+投资收益');
INSERT INTO `par_formula_total` VALUES (52, '利润表', '减：营业税金及附加', '营业收入×5%');
INSERT INTO `par_formula_total` VALUES (53, '利润表', '减：营业外支出', '∑（预计算次数×每次收费标准），标准为：1次，0；2-3次，每次100万；4-5次，每次500万；第6次，1000万。最多6次，次数为累计数');
