INSERT INTO `par_formula_total` VALUES (120, '人事后勤数据分析', '加班时间', '需要营业时间—可用营业时间（加班时间≤可用营业时间*10%）；当加班时间>可用营业时间*10%，多出部分将由雇佣临时工代替；需要营业时间—可用营业时间≤0,则不需要加班');
