INSERT INTO `par_formula_total` VALUES (124, '人事后勤数据分析', '加班时间', '没有加班时间得10分，加班时间<可用营业时间10%的0.5倍得7分，加班时间在可用营业时间10%的0.5倍到1倍之间得4分，需要雇佣临时工的得0分。');
