  `retained_profits` int(10) NULL DEFAULT NULL COMMENT '净利润',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '初始数据表-利润' ROW_FORMAT = Dynamic;

